import React from 'react';
import { Image, StyleSheet, TouchableOpacity, View } from 'react-native';
import Animated, { useAnimatedStyle, useSharedValue, withSpring } from 'react-native-reanimated';
import { COLORS, FONTS, SIZES } from '../../../constants/theme';

import home from '../../../assets/images/icons/home2.png';
import collage from '../../../assets/images/icons/collage.png';
import profile from '../../../assets/images/icons/user2.png';
import heart from '../../../assets/images/icons/heart.png';
import blog from '../../../assets/images/icons/blog.png';

const CustomNavigation = ({state,navigation,descriptors}) => {
    
    const offset = useSharedValue((SIZES.width - 40) / 2.5);

    const tabShapeStyle = useAnimatedStyle(() => { 
        return {
            transform: [
                { 
                    translateX:  offset.value
                }
            ],
        };
    });

    return (
        <>
            <View style={{
                height:65,
                flexDirection:'row',
                position:'absolute',
                width:'auto',
                paddingHorizontal:10,
                left:10,
                right:10,
                bottom:10,
                borderRadius: 20,
                backgroundColor: COLORS.white,
                shadowColor: "rgba(0,0,0,.6)",
                shadowOffset: {
                    width: 0,
                    height: 4,
                },
                shadowOpacity: 0.30,
                shadowRadius: 4.65,

                elevation: 8,
            }}>
                <Animated.View
                    style={[tabShapeStyle]}
                >
                    <View style={{
                        width: (SIZES.width - 40) / 5,
                        position:'absolute',
                        zIndex:1,
                        bottom: 7.5,
                        left:0,
                        alignItems:'center',
                        justifyContent:'center',
                    }}>
                        <View
                            style={{
                                height:4,
                                width:50,
                                borderRadius:6,
                                backgroundColor:COLORS.primary,
                            }}
                        />
                    </View>
                </Animated.View>
                {state.routes.map((route, index) => {

                    const { options } = descriptors[route.key];
                    const label =
                    options.tabBarLabel !== undefined
                        ? options.tabBarLabel
                        : options.title !== undefined
                        ? options.title
                        : route.name;

                    const isFocused = state.index === index;
                    
                    const onPress = () => {
                        const event = navigation.emit({
                            type: 'tabPress',
                            target: route.key,
                            canPreventDefault: true,
                        });

                        if (!isFocused && !event.defaultPrevented) {
                            navigation.navigate({ name: route.name, merge: true });
                        }

                        if(route.name == "Home"){
                            var a =  0;
                        }else if(route.name == "Markets"){
                            var a =  (SIZES.width - 40) / 5;
                        }else if(route.name == "Change"){
                            var a =  (SIZES.width - 40) / 2.5;
                        }
                        else if(route.name == "Wallet"){
                            var a =  (SIZES.width - 40) / 2.5 + (SIZES.width - 40) / 5;
                        }
                        else if(route.name == "Profile"){
                            var a =  (SIZES.width - 40) - (SIZES.width - 40) / 5;
                        }
                        var b = withSpring(a);
                        offset.value = b

                    }

                    return(
                        <View style={styles.tabItem} key={index}>
                            <TouchableOpacity
                                style={styles.tabLink}
                                onPress={onPress}
                            >
                                <Image
                                    style={{
                                        height:22,
                                        width:22,
                                        resizeMode:'contain',
                                        marginBottom:5,
                                        opacity:isFocused ? 1 : .6,
                                        tintColor:isFocused ? COLORS.primary : COLORS.text,
                                    }}
                                    source={
                                        label === "Home" ? home :
                                        label === "Markets" ? heart:
                                        label === "Change" ? collage:
                                        label === "Wallet" ? blog :
                                        label === "Profile" && profile
                                    }
                                />
                            </TouchableOpacity>
                        </View>
                    )
                })}
            </View>
        </>
    );
};



const styles = StyleSheet.create({
    tabLink:{
        alignItems:'center',
    },
    tabItem:{
        flex:1,
        alignItems:'center',
        justifyContent:'center',
    },
    navText:{
        ...FONTS.fontSm,
    }
})


export default CustomNavigation;
